INSERT INTO `tbl_communications` (`commid`, `category_name`, `subject`, `message`, `created_date_time`) VALUES
(1, 'activation_mail_m', 'Account Activation', '<img class="img-responsive" src="http://piscore.in/assets/front_styles/images/pi_score_new.png" width="30%"><br>\n<p style="color:#777;font-family:helvetica;font-style:italic;font-size:28px";>Now, Always Get Sales > Your Ad Spends</p>\n <div style="color:#4da4af;font-family:Calibri;">\n<h2 style="color:#4da4af;font-size:20px;">Account Activation</h2>\n<p style="margin-top:-20px;">Hello, FULLNAME</p>\n		<p>Thank you for registering with our website. To complete the process of sign-up please follow the below steps:</p>\n		<p><strong>Step 1</strong> : SMS the given OTP via your registered mobile number to 9030423457.</p>\n		<p>Your OTP: <span  style="font-size:20px;font-weight:800;">MOBILE_ACTIVATION_CODE</span></p>\n		Example: OTP to 9030423457<br><br>\n		\n		</p>\n		<p><strong>Step 2</strong> : Click the activation button provided below to verify your email address.</p>\n		\n		<p style=""><a href="ACTIVATION_LINK" class="button-0">Click to Activate</a></p>\n		<p>Your Pay India account is subjected to following Terms & Conditions. \n		<a href="https://piscore.in/application/views/terms-conditions.php">Read here</a><br>\n		For any issues feel free to contact <a href="mailto:customercare@piscore.in">Customer Care</a></p>\n		<p><strong>Regards,</strong> <br> PI Team</p>', '2016-08-10 07:32:33'),
(2, 'Forgot Password', 'Forgot Password', '<img class="img-responsive" src="http://piscore.in/assets/front_styles/images/pi_score_new.png" width="30%"><br>\n<p style="color:#777;font-family:helvetica;font-style:italic;font-size:28px";>Now, Always Get Sales > Your Ad Spends</p>\n <div style="color:#4da4af;font-family:Calibri;">\n<h2 style="color:#4da4af;font-size:20px;">Forgot Password</h2><br>\n<p style="margin-top:-20px;">Hi,</p>\n		<p style="text-align:justify;font-size:15px;margin-top:-10px;;">  Click the link below to reset you account password:</p> <p>Activation Link: <a href="ACTIVATION_LINK">ACTIVATION_LINK</a></p> <p>Regards, <br> PI Team</p>\n		</div>', '2016-08-10 07:26:04'),
(3, 'feedbackform', 'feedbackform', '<img class="img-responsive" src="http://piscore.in/assets/front_styles/images/pi_score_new.png" width="30%"><br>\n<p style="color:#777;font-family:helvetica;font-style:italic;font-size:28px";>Now, Always Get Sales > Your Ad Spends</p>\n <div style="color:#4da4af;font-family:Calibri;">\n		<p style="color:#4da4af;font-family:Calibri;">MESSAGE</p>\n			\n		<p><strong>Regards,</strong> <br> SENDERNAME</p>\n	</div>\n', '2016-08-10 07:24:41'),
(4, 'contact_store', 'Contact Store', '\n<html>\n<head>\n<style>\n.top-img {\n  background-color: #fff;\n  border: 1px solid #4da7af;\n  color: #fff;\n  text-decoration: none;\n  font-weight: 500;\n  font-size: 16px;\n  padding: 20px;\n  text-align: center;\n  border-radius: 3px 3px 0 0;\n}\n.top-label {\n	color:#777;\n	font-family:helvetica;\n	font-style:italic;\n	font-size:28px;\n	text-align: center;\n}\n\n.message-label {\n	font-family:helvetica;\n	font-size:20px;\n}\n\n.message-content {\n	font-family:helvetica;\n	font-size:16px;\n	font-weight:200;\n}\n\n.message-footer {\n	font-family:helvetica;\n	font-size:16px;\n	font-weight:200;\n}\n\n.invoice {\n  margin: 40px auto;\n  text-align: left;\n  width: 80%;\n}\n.invoice td {\n  padding: 10px;\n}\n.invoice .invoice-items {\n  width: 100%;\n}\n.invoice .invoice-items td {\n  border-top: #eee 1px solid;\n}\n.invoice .invoice-items .total td {\n  border-top: 2px solid #333;\n  border-bottom: 2px solid #333;\n  font-weight: 700;\n}\n\n</style>\n</head>\n\n<body>\n<div class="top-img">\n<img class="img-responsive" src="http://pistorehub.com/assets/front_styles/images/PI-Store1.png">\n</div>\n<br>\n<p class="top-label">Now, Always Get Sales > Your Ad Spends</p>\n\n<p class="message-label">Dear STORE_NAME,</p>\n<p class="message-content">Greetings from pivalue.in , One of our users might soon get in touch with you for best deals, all the best for your business. Below are the contact details of Customer:</p>\n\n<table class="invoice" cellpadding="0" cellspacing="0" border="1" style="width:50%;">\n<tbody>\n<tr>\n<td>Name: </td>\n<td>CUSTOMER_NAME</td>\n</tr>\n<tr>\n<td>Email ID: </td>\n<td>CUSTOMER_EMAIL</td>\n</tr>\n<tr>\n<td>Contact: </td>\n<td>CUSTOMER_CONTACT</td>\n</tr>\n<tr>\n<td>Requirements: </td>\n<td>CUSTOMER_REQUIREMENTS</td>\n</tr>\n</tbody>\n</table>\n\n<p class="message-footer"><strong>Regards,</strong> <br> Team PI</p>\n\n</body>\n</html>', '2016-08-29 09:13:24'),
(5, 'inventory_email', 'Maintain Inventory', '\n<html>\n<head>\n<style>\n.top-img {\n  background-color: #fff;\n  border: 1px solid #4da7af;\n  color: #fff;\n  text-decoration: none;\n  font-weight: 500;\n  font-size: 16px;\n  padding: 20px;\n  text-align: center;\n  border-radius: 3px 3px 0 0;\n}\n.top-label {\n	color:#777;\n	font-family:helvetica;\n	font-style:italic;\n	font-size:28px;\n	text-align: center;\n}\n\n.message-label {\n	font-family:helvetica;\n	font-size:20px;\n}\n\n.message-content {\n	font-family:helvetica;\n	font-size:16px;\n	font-weight:200;\n}\n\n.message-footer {\n	font-family:helvetica;\n	font-size:16px;\n	font-weight:200;\n}\n\n.invoice {\n  margin: 40px auto;\n  text-align: left;\n  width: 80%;\n}\n.invoice td {\n  padding: 10px;\n}\n.invoice .invoice-items {\n  width: 100%;\n}\n.invoice .invoice-items td {\n  border-top: #eee 1px solid;\n}\n.invoice .invoice-items .total td {\n  border-top: 2px solid #333;\n  border-bottom: 2px solid #333;\n  font-weight: 700;\n}\n\n</style>\n</head>\n\n<body>\n<div class=''top-img''>\n<img class=''img-responsive'' src=''http://pistorehub.com/assets/front_styles/images/PI-Store1.png''>\n</div>\n<br>\n<p class=''top-label''>Now, Always Get Sales > Your Ad Spends</p>\n\n<p class=''message-label''>Dear STORE_NAME,</p>\n<p class=''message-content''>Greetings from piscore.in, One of our users had placed an order quantity which is out of stock with you. Please maintain the required inventory to avoid sales loss. Our Inventory Manager will soon get in touch with you regarding this issue. Below are the contact details of Customer and please attend the issue within 3 days for continuous business</p>\n\n<table class=''invoice'' cellpadding=''0'' cellspacing=''0'' border=''1'' style=''width:50%;''>\n<tbody>\n<tr>\n<td>Order ID: </td>\n<td>ORDER_ID</td>\n</tr>\n<tr>\n<td>Quantity: </td>\n<td>QTY</td>\n</tr>\n<tr>\n<tr>\n<td>Campaign Name: </td>\n<td>CAMPAIGN_NAME</td>\n</tr>\n<tr>\n<td>Product Name: </td>\n<td>PRODUCT_NAME</td>\n</tr>\n<tr>\n<td>Product Price: </td>\n<td>PRODUCT_PRICE</td>\n</tr>\n<td>Order Value: </td>\n<td>ORDER_VALUE</td>\n</tr>\n</tbody>\n</table>\n<p class=''message-content''>All the best for your business. </p>\n<p class=''message-footer''><strong>Regards,</strong> <br> Team PI</p>\n\n</body>\n</html>', '2017-02-07 13:27:18'),
(6, 'inventory_email_web', 'Maintain Inventory', '\n<html>\n<head>\n<style>\n.top-img {\n  background-color: #fff;\n  border: 1px solid #4da7af;\n  color: #fff;\n  text-decoration: none;\n  font-weight: 500;\n  font-size: 16px;\n  padding: 20px;\n  text-align: center;\n  border-radius: 3px 3px 0 0;\n}\n.top-label {\n	color:#777;\n	font-family:helvetica;\n	font-style:italic;\n	font-size:28px;\n	text-align: center;\n}\n\n.message-label {\n	font-family:helvetica;\n	font-size:20px;\n}\n\n.message-content {\n	font-family:helvetica;\n	font-size:16px;\n	font-weight:200;\n}\n\n.message-footer {\n	font-family:helvetica;\n	font-size:16px;\n	font-weight:200;\n}\n\n.invoice {\n  margin: 40px auto;\n  text-align: left;\n  width: 80%;\n}\n.invoice td {\n  padding: 10px;\n}\n.invoice .invoice-items {\n  width: 100%;\n}\n.invoice .invoice-items td {\n  border-top: #eee 1px solid;\n}\n.invoice .invoice-items .total td {\n  border-top: 2px solid #333;\n  border-bottom: 2px solid #333;\n  font-weight: 700;\n}\n\n</style>\n</head>\n\n<body>\n<div class=''top-img''>\n<img class=''img-responsive'' src=''http://pistorehub.com/assets/front_styles/images/PI-Store1.png''>\n</div>\n<br>\n<p class=''top-label''>Now, Always Get Sales > Your Ad Spends</p>\n\n<p class=''message-label''>Dear STORE_NAME,</p>\n<p class=''message-content''>Greetings from piscore.in, Please maintain the required inventory of minimum 3 units to avoid sales loss of <strong>PRODUCT_NAME</strong>. Our Inventory Manager will soon get in touch with you regarding this issue.</p>\n\n<p class=''message-content''>All the best for your business. </p>\n<p class=''message-footer''><strong>Regards,</strong> <br> Team PI</p>\n\n</body>\n</html>', '2017-02-07 13:21:22'),
